INSERT INTO `recruiter_details` VALUES (1,'benz','Mercedes-Benz','data:image/jpeg;base64,','#37393a','sreerajs1063@gmail.com','',NULL,'34/North Street,7th Road','112324','New York','USA','0000111122','Automobile',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-07-25 03:56:45','2024-07-27 10:35:15'),(2,'raven_official','Raven Aeronautics','data:image/jpeg;base64,','#eae8e7','bijocif412@modotso.com','Adrenaline is key','At Raven Aeronautics, we are dedicated to pushing the boundaries of aviation technology and innovation. Located in the heart of Sydney, Australia, our company is at the forefront of the aerospace industry, specializing in the design, development, and manufacturing of advanced aeronautical systems and solutions.\nWho We Are\n\nRaven Aeronautics is a leading aerospace firm with a focus on delivering cutting-edge technology and unparalleled expertise in aircraft design and maintenance. Our team of highly skilled engineers, technicians, and industry professionals is committed to advancing aviation through groundbreaking research and development, rigorous testing, and state-of-the-art manufacturing practices.\nOur Mission\n\nOur mission is to revolutionize the aviation sector by creating innovative, efficient, and reliable solutions that enhance performance, safety, and sustainability. We strive to exceed industry standards and customer expectations with our commitment to excellence and our passion for technological advancement.','Sydney','1234567','Sydney','Australia','1234567890','Aeronautical',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-07-25 04:10:47','2024-07-26 20:48:20'),(3,'my_design','My Design Space LTD','data:image/jpeg;base64,','#faf7f7','ggplknight@gmail.com','',NULL,'Door no 38, Sy No. 373/11, 1711, Thrikkakara, Vazhakkala, Kochi, Kerala 682021','142563','Kochi','USA','0000111122','Defense',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-07-25 04:51:04','2024-07-27 20:46:42'),(4,'Sid','SCORP',NULL,'#729b5b','sidharthsathyamkrishna@gmail.com','\n\nScorp Defense Research Organization stands as a beacon of innovation and excellence in the realm of defense technology. Founded on a legacy of pioneering advancements, Scorp DRO is dedicated to pushing the boundaries of defense research and development to safeguard nations and empower defense forces worldwide.','Scorp Defense Research Organization stands as a beacon of innovation and excellence in the realm of defense technology. Founded on a legacy of pioneering advancements, Scorp DRO is dedicated to pushing the boundaries of defense research and development to safeguard nations and empower defense forces worldwide.\n\nWith headquarters nestled in the heart of innovation hubs, Scorp DRO attracts top-tier talent and collaborators from across the globe. Our multidisciplinary team of engineers, scientists, and strategists works tirelessly to conceptualize, design, and deploy cutting-edge solutions that address the most complex security challenges of today and tomorrow.\n\nAt Scorp DRO, we leverage state-of-the-art facilities and advanced simulation capabilities to drive technological breakthroughs in aerospace, land systems, maritime defense, and cybersecurity. Our commitment to excellence is unwavering, ensuring that every solution we deliver meets the highest standards of performance, reliability, and sustainability.\n\nBeyond innovation, Scorp DRO is dedicated to fostering partnerships with governments, military agencies, and industry leaders to shape the future of defense capabilities. Together, we forge strategic alliances that enhance global security and resilience in an increasingly complex geopolitical landscape.\n\nAs we continue to evolve and adapt to emerging threats and opportunities, Scorp DRO remains steadfast in its mission to advance the frontiers of defense technology, safeguarding peace and security worldwide through innovation, integrity, and ingenuity.','  Street:  Excelsior Bldg Yau Ma Tei  City:   Yau Tsim Mong District  State/province/area:    Hong Kong  Phone number:  2782 9999  Country calling code:  +852 Country:  Hong Kong ','78907','Hong Kong','China','9995559990','Defense','10000','Hong Kong,China',NULL,NULL,'','SCORP@gamil.com','22','2024-07-25 05:05:38','2024-07-25 05:46:16'),(5,'Sreeju_Akasam','Kottackal',NULL,'#a7a8a8','sreejuworks647@gmail.com',NULL,NULL,'kotta,pondi,india','689112','Pondicherry','India','8765674337','Chemical',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-07-25 05:46:13','2024-07-25 05:46:13'),(6,'jonathan','Roguestar',NULL,NULL,'roguestar60@gmail.com',NULL,NULL,'Andheri street','400053','Mumbai','India','9496753692','Automobile',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2024-07-25 06:07:49','2024-07-25 06:07:49'),(7,'ford','Ford Motor Company','data:image/jpeg;base64,','#6d6a63','backupsreyas@gmail.com','',NULL,'Dearborn, Michigan, United States','683574','Kochi','India','9645849576','Automobile','50000','',NULL,NULL,NULL,NULL,'','2024-07-25 17:30:57','2024-07-27 18:04:35'),(8,'void_fashion','Void','data:image/png;base64,','#3a415e','hisih25791@digdy.com','',NULL,'Nurburgring','12345','Nurburgring','Antigua and Barbuda','1234567890','Fashion','','Argentina',NULL,NULL,NULL,NULL,'','2024-07-26 05:26:11','2024-07-27 21:32:37'),(9,'kalyan','Kalyan Silks',NULL,'','sreyasbackup2@gmail.com','',NULL,'Mattoor,Kalady,Kerala,India','683574','Kochi','India','9645849576','Fashion',NULL,NULL,NULL,NULL,'','',NULL,'2024-07-26 14:45:49','2024-07-26 15:54:48'),(10,'AI_Mission','AI Conquer Pvt.Ltd',NULL,NULL,'genaistartup@gotgel.org',NULL,NULL,'3785 Blackwell Street','99574','Cordova','USA','2084422888','IT','','',NULL,NULL,NULL,NULL,'','2024-07-27 17:50:04','2024-07-27 17:52:15');
